# Example 1:
#
# Input: nums = [1,1,2]
# Output: 2, nums = [1,2,_]
# Explanation: Your function should return k = 2, with the first two elements of nums being 1 and 2 respectively.
# It does not matter what you leave beyond the returned k (hence they are underscores).

def remove_duplicates(initial_list):

    unique_nums = []
    index = 0

    if len(initial_list) == len(set(initial_list)):
        k = len(initial_list)
        return k
    else:

        while initial_list[index] != "_":
            if initial_list[index] not in unique_nums:
                unique_nums.append(initial_list[index])
                index += 1
            else:
                initial_list.remove(initial_list[index])
                initial_list.append("_")

    k = len(unique_nums)

    return k, initial_list

