# Example 1:
#
# Input: s = "egg", t = "add"
# Output: true
# Example 2:
#
# Input: s = "foo", t = "bar"
# Output: false
# Example 3:
#
# Input: s = "paper", t = "title"
# Output: true

def isomorphic_strings(s, t):

    alphabet = {}

    if len(s) == len(t):
        for index, letter in enumerate(s):
            if letter not in alphabet:
                if t[index] in alphabet.values():
                    return False
                else:
                    alphabet[letter] = t[index]

            else:
                if t[index] != alphabet[letter]:
                    return False

        return True

    else:
        return False

